import React from 'react'
import { Card, CardTitle } from "react-materialize"

function PortfolioProject(props) {

    return (

            <Card className='large'
                header={<CardTitle image={props.projectData.image}></CardTitle>}
                title={props.projectData.title}
                actions={[<a href={props.projectData.github}><i class="fab fa-github"></i></a>]}>
                <a class="btn-floating halfway-fab waves-effect waves-light red"><i class="material-icons">add</i></a>
                <p>{props.projectData.description}</p>
                <p>{props.projectData.technologies}</p>
            </Card>
    )
}

export default PortfolioProject
